import React from 'react'

function Displayicon(props){

    return(
          <div id="services">
      {props.details.map((service, index) => {

        return (
          <>
          <div className="service"  >
            <ul className="icon"  >

            <img src={service.icon} alt=""  />


            </ul>


            <h3>{service.title}</h3>
            {/* <p>{service.subTitle}</p> */}

          </div>





          </>
        );
      })}
    </div>




    )
}
export default Displayicon;
